import React, { useState } from 'react';
import AppBar from '@mui/material/AppBar';
import Button from '@mui/material/Button';
import LocalGroceryStoreIcon from '@mui/icons-material/LocalGroceryStore';
import LogoutIcon from '@mui/icons-material/Logout';
import CssBaseline from '@mui/material/CssBaseline';
import Toolbar from '@mui/material/Toolbar';
import Typography from '@mui/material/Typography';
import { Link as RouterLink, useNavigate } from 'react-router-dom';
import { Box, Container, Modal } from '@mui/material';
import MenuIcon from '@mui/icons-material/Menu';
import AccountCircleIcon from '@mui/icons-material/AccountCircle';
import './homeStyle.css'
import httpService from '../../services/httpService'

const Home = () => {
    const [openModal, setOpenModal] = useState(false);

  const handleModalOpen = () => {
    setOpenModal(true);
  };

  const handleModalClose = () => {
    setOpenModal(false);
  };

    const handleSignOut = () => {
        localStorage.removeItem("token")
      }
  return (
    <>
        <CssBaseline />
        <AppBar position="relative">
          <Toolbar>
            <Button onClick={handleModalOpen}>
          Menu
        </Button>

        <Modal
          open={openModal}
          onClose={handleModalClose}
          aria-labelledby="modal-title"
          aria-describedby="modal-description"
        >
          <Box
            sx={{
              position: 'absolute',
              top: '50%',
              left: '50%',
              transform: 'translate(-50%, -50%)',
              bgcolor: 'background.paper',
              boxShadow: 24,
              p: 4,
              maxWidth: 300,
              minWidth: 200,
              borderRadius: 4,
            }}
          >
            <Button component={RouterLink} to="/account" onClick={handleModalClose} fullWidth>
              <AccountCircleIcon sx={{ marginRight: 1 }} />
              Conta
            </Button>
            <Button component={RouterLink} to="/library" onClick={handleModalClose} fullWidth>
              Biblioteca
            </Button>
            <Button onClick={handleSignOut} fullWidth>
              <LogoutIcon sx={{ marginRight: 1 }} />
              Sair
            </Button>
          </Box>
        </Modal>
            <Box className='moviePlay'>
                <Typography variant="h6" color="inherit" noWrap className='moviePlay_text'>
                    MoviePlay
                </Typography>
            </Box>
  
            <Box style={{ display: 'flex', alignItems: 'center', marginLeft: 'auto' }}>
                <AccountCircleIcon fontSize='large'/>
            </Box>
          </Toolbar>
        </AppBar>
    </> 
  )
}

export default Home
